import React, { useState } from 'react';
import { Navbar, Nav, Form, FormControl, Button } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

function CustomNavbar() {
  const [searchVisible, setSearchVisible] = useState(false);

  return (
    <Navbar bg="dark" variant="dark" expand="lg">
      <Navbar.Brand href="#home">
        <img
          src="/path/to/your/logo.png"
          width="30"
          height="30"
          className="d-inline-block align-top"
          alt="Brand Logo"
        />
      </Navbar.Brand>
      <Nav className="mr-auto">
        <Nav.Link href="#link1">Link1</Nav.Link>
        <Nav.Link href="#link2">Link2</Nav.Link>
        <Nav.Link href="#link3">Link3</Nav.Link>
        <Nav.Link href="#link4">Link4</Nav.Link>
        <Nav.Link href="#link5">Link5</Nav.Link>
      </Nav>
      <Form inline className="ml-auto">
        <Button onClick={() => setSearchVisible(!searchVisible)} variant="outline-light">
          <i className="bi bi-search"></i>
        </Button>
        {searchVisible && (
          <FormControl type="text" placeholder="Search" className="mr-sm-2" />
        )}
      </Form>
    </Navbar>
  );
}

export default CustomNavbar;
